import React, { Component } from "react";
import { AppBar, Toolbar, IconButton, Button } from "@material-ui/core";
import HomeIcon from "@material-ui/icons/Home";
import { withRouter } from "react-router-dom";

import AccountCircleIcon from "@mui/icons-material/AccountCircle";

export class ExploreNavBar extends Component {
    goToUpload() {
        window.location.assign('http://localhost:3001/upload');    }
    goToBlockExplorer() {
        window.location.assign('http://localhost:3000/');
    }
    goToVerify() {
        window.location.assign('http://localhost:3001/verify');
    }

    render() {
        return (
            <AppBar style={{
                backgroundColor: "rgb(53, 110, 255)",
            }} position="static">
                <Toolbar>
                    <IconButton
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                    ></IconButton>
                    <HomeIcon
                        id="home"
                        onClick={() => {
                            this.goToUpload();
                        }}
                    />
                    <AccountCircleIcon id="home" />
                    <Button
                      id="history"
                        color="inherit"
                        onClick={() => {
                            this.goToUpload();
                        }}
                    >
                        Upload 
                    </Button>{" "}
                    <Button
                    id="history"
                        color="inherit"
                        onClick={() => {
                            this.goToVerify();
                        }}
                    >
                        Verify 
                    </Button>{" "}
                    <Button
                        id="history"
                        color="inherit"
                        onClick={() => {
                            this.goToBlockExplorer();
                        }}
                    >
                        {" "}
                     Explore{" "}
                    </Button>

                </Toolbar>
            </AppBar>
        );
    }
}

export default withRouter(ExploreNavBar);
